import React from 'react'
import picOne from './1.jpg'
import picTwo from './2.jpg'
import picThree from './3.jpg'
import picFour from './4.jpg'
import vidOne from './1.mp4'
import vidTwo from './2.mp4'
import vidThree from './3.mp4'

import ('./Pics.css')

export default class Pics extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      pics: null
    }
  }

  componentDidMount() {
    const pics = [
      picOne,
      picTwo,
      picThree,
      picFour,
      vidOne,
      vidTwo,
      vidThree
    ]
    const picChooser = setInterval(() => {
      this.setState({
        pic: pics[Math.floor(Math.random() * pics.length)]
      })
    }, 10000)
  }
  render() {
    return(
      <div className="Pics">
      {[vidOne, vidTwo, vidThree].includes(this.state.pic)? <video loop autoPlay muted src={this.state.pic} /> : <img src={this.state.pic} />}
      </div>
    )
  }
}
